import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";

export default class about extends Component {
  render() {
    return (
        <Container className="_container" fluid>
         <h3 className="aboutTitle">Yetenek ve Tecrübelerim</h3>
          <Row>
            <Col md>
            <h4 className="_title"><span className="_titleİn">Deneyimlerim</span></h4>
            </Col>
            <Col md>
            <h4 className="_title"><span className="_titleİn">Program Bilgileri</span></h4>
            </Col>
          </Row>

          <Row>
            <Col md>
            <h4 className="_title"><span className="_titleİn">Eğitim Bilgilerim</span></h4>
            </Col>
            <Col md>
            <h4 className="_title"><span className="_titleİn">Kodlama Bilgileri</span></h4>
            </Col>
          </Row>
        </Container>
     
    );
  }
}
